export class PerformanceModel {
	constructor(data) {
		this.id = data.data.userId;
		this.kind = data.kind;
		this.kindValues = data.data;
	}

	getProcessedDatas() {
		let kindValues = this.kindValues;
		let kind = [];
		kind.indexOf(this.kind) === -1 && kind.push(this.kind);
		console.log(kind);
		let datas = [];
		kindValues.forEach((kindValue) => {
			datas.push({
				subject: kindValue.kind,
				value: kindValue.value,
			});
		});
		console.log(datas);
		return datas;
	}
}
